	var LINES_PER_FRAME = 14;
	var COLS_PER_FRAME = 67;
	var FRAME_DURATION = 67;
	
	var VT_ALTSCRBUFFER = "\x1B[?1049h"; // Use Alternate Screen Buffer
	var VT_MAINSCRBUFFER = "\x1B[?1049l"; // Use Main Screen Buffer
	var VT_CUP_HOME = "\x1B[H"; // Move cursor to 1st column of 1st row
	var VT_HIDECURSOR = "\x1B[?25l"; // Hide the cursor
	var VT_SHOWCURSOR = "\x1B[?25h"; // Show the cursor
	var line;
	
	// Compute total number of uncompressed frames.
	// This is used to provide an accurate progress bar below the movie.
	var total_framecount = 0;
	for (line = 0; line < film.length; line += LINES_PER_FRAME) {
		total_framecount += parseInt(film[line], 10);
	}
	
	// Prevent computer and monitor from going to sleep during playback
	var keepAwake = new ActiveXObject("AXSH.KeepAwake");
	keepAwake.display = true; // Keep computer on, including display and audio, even if there is no user activity.
	// No need to clear this before we return as the KeepAwake object going out of scope is enough to cleanup.
	
	// Play movie
	AXSH.echo(VT_ALTSCRBUFFER + VT_HIDECURSOR + VT_CUP_HOME);
	var current_framecount = 0;
	for (line = 0; line < film.length; line += LINES_PER_FRAME) {
		var frame_repeat = parseInt(film[line], 10);
		var frame = film.slice(line+1, line+LINES_PER_FRAME);
		
		AXSH.echo(VT_CUP_HOME + "\r\n" + frame.join("\r\n") + "\r\n");
		AXSH.echo(getProgressBar(current_framecount, total_framecount, COLS_PER_FRAME));
		AXSH.sleep(frame_repeat * FRAME_DURATION);
		
		current_framecount += frame_repeat;
	}
	
	// Finished playback
	AXSH.echo(VT_SHOWCURSOR + VT_MAINSCRBUFFER);
